import React from 'react'
import { Link } from 'react-router-dom';

const Video = (props) => {
    const {image} = props;

    return (
        <Link>
        <div className="col-6">
            <img src={image} className="w-100 h-100 mt-2 mb-2" />
        </div>
        </Link>
    )
}

export default Video
